pragma solidity ^0.8.4;

contract Array {
    int256[10] public myArray;

    constructor() {
        myArray[0] = 42;
        myArray[1] = -86;
        myArray[2] = 69;
        myArray[3] = 30;
        myArray[4] = -85563;
    }
    function get(uint8 index) public view returns (int256) {
        require(index < 10);
        return myArray[index];
    }

    function set(uint8 index, int256 value) public {
       require(index < 10);
       myArray[index] = value;
    }

}

